import React from "react";
import Technologies from "./Technologies";

const SkillsSection = () => (
  <section id="skills" className="min-h-screen flex py-4 relative">
    <div className="max-w-7xl mx-auto px-6 relative z-10">
      <div className="text-center m-auto gap-5">
        
      <h2 className="text-3xl md:text-4xl font-bold inline-block relative">
                My Skills
                <span className="absolute bottom-0 left-0 w-full h-1 bg-[#64FFDA]/50 -mb-2"></span>
              </h2>
              <p className="text-gray-400 mt-2 max-w-2xl mx-auto">
                I've worked with a variety of technologies in the web development world.
                Here's a snapshot of my technical expertise and proficiency levels.
              </p>
      </div>
    </div>
  </section>
);

export default SkillsSection;
